          "id": "44ef2a17edf77ee38f7b1712ee3bdcf475f5301b",
          "message": "Support click 8.2 (#6959)\n\nChanges needed (https://click.palletsprojects.com/en/stable/changes/#version-8-2-0):\n- In click 8.2.0, just running verdi or python -m aiida without \nany arguments returns non-zero exit code. \nSome tests needed to be adjusted to account for this. \n- Help shown via `no_args_is_help` results in exit code 2, was 0 pallets/click#1489\n- Keep stdout and stderr streams independent in CliRunner.\n This needed an adjustment in tests/conftest.py\n- Added tests for cmdline.params.types.choice\n- I've kept an upper pin for the click dependency.\n  Since we patch a lot of click's behaviour and rely on its implementation details,\n  it's likely that new version introduce breakages so we should guard against that.",
