          "id": "b02a233afecfbb2087b9d281c6be3f99fdbbc65f",
          "message": "Fixes a critical race condition in TransportQueue.\n\nThe race condition occurred when async transport closure yielded to the event loop, allowing new tasks to receive references to transports being closed.\nThe fix ensures transport requests are removed from the dictionary before calling close(), preventing this interleaving.\nMoved _transport_requests.pop() to execute before transport.close() in TransportQueue to fix race condition.",
