          "id": "9f03a8e4cad4764ac99a39b12677036eefe1a2ca",
          "message": "Fix: Avoid mutating `_polling_jobs` inside (slurm) scheduler (#7155)\n\nSLURM scheduler mutated caller's job list in-place, causing duplicate\nentries in job manager's polling loop. This led to futures being\nresolved with None after jobs were purged, corrupting CalcJob state.\n\nSolution: Copy job list before mutation (slurm.py) and use immutable\nfrozenset for _polling_jobs (manager.py).\n\n---------\n\nCo-authored-by: Ali Khosravi <khsrali@gmail.com>\nCo-authored-by: Daniel Hollas <daniel.hollas@bristol.ac.uk>",
          "timestamp": "2025-12-19T11:45:42+01:00",
