          "id": "b3cf7b4c715bb84cde5caae13004fb28d2d996e2",
          "message": "Fix script to autogenerate module re-imports and __all__ attributes (#7091)\n\nThe `make_all.py` script that is invoked by the `imports` pre-commit hook\n was not working ever since we moved to the src/aiida layout. :-(\nThis script is made to ensure that the module attributes specified in `__all__`\nare re-exported and the second level in the aiida namespace.\n\nBesides fixing the script, this commit also includes:\n- rename the script to `autogenerate_all_imports.py`\n- fixes for Python 3.14 (deprecations from ast module)\n- compatibility with ruff (isort order for __all__ attributes)\n- don't special case tools.archive module\n- better error handling and error reporting\n\nDuring the time that the script was not working, many import incosistencies\nslipped through. Most of them were fixed in previous PRs,\nbut this also includes some minor new re-exports.",
